var fileJSON=[{"path":"/homes/connie/opencl/CNN/cnn_block_maxTs/device/cnn.cl", "name":"cnn.cl", "has_active_debug_locs":false, "absName":"/homes/connie/opencl/CNN/cnn_block_maxTs/device/cnn.cl", "content":"/*****************************************************************************\012 * Copyright (c) 2013-2016 Intel Corporation\012 * All rights reserved.\012 *\012 * WARRANTY DISCLAIMER\012 *\012 * THESE MATERIALS ARE PROVIDED BY THE COPYRIGHT HOLDERS AND CONTRIBUTORS\012 * \"AS IS\" AND ANY EXPRESS OR IMPLIED WARRANTIES, INCLUDING, BUT NOT\012 * LIMITED TO, THE IMPLIED WARRANTIES OF MERCHANTABILITY AND FITNESS FOR\012 * A PARTICULAR PURPOSE ARE DISCLAIMED. IN NO EVENT SHALL INTEL OR ITS\012 * CONTRIBUTORS BE LIABLE FOR ANY DIRECT, INDIRECT, INCIDENTAL, SPECIAL,\012 * EXEMPLARY, OR CONSEQUENTIAL DAMAGES (INCLUDING, BUT NOT LIMITED TO,\012 * PROCUREMENT OF SUBSTITUTE GOODS OR SERVICES; LOSS OF USE, DATA, OR\012 * PROFITS; OR BUSINESS INTERRUPTION) HOWEVER CAUSED AND ON ANY THEORY\012 * OF LIABILITY, WHETHER IN CONTRACT, STRICT LIABILITY OR TORT (INCLUDING\012 * NEGLIGENCE OR OTHERWISE) ARISING IN ANY WAY OUT OF THE USE OF THESE\012 * MATERIALS, EVEN IF ADVISED OF THE POSSIBILITY OF SUCH DAMAGE.\012 *\012 * Intel Corporation is the author of the Materials, and requests that all\012 * problem reports or change requests be submitted to it directly\012 *****************************************************************************/\012\012#include \"../host/inc/instance.h\"\012\012__kernel void cnn(__global float* restrict input, __global float* restrict weights, __global float* restrict output, \012				const int Tm, const int Tr, const int Tc, const int Tn)\012{\012	unsigned long to = get_global_id(0) * Tm;\012	unsigned long row = get_global_id(1) * Tr;\012	unsigned long col = get_global_id(2) * Tc;\012	\012	__local float BufI[max_Tn][max_Tr*S_wts+K_wts-1][max_Tc*S_wts+K_wts-1];\012	__local float BufO[max_Tm][max_Tr][max_Tc];\012	__local float BufW[max_Tm][max_Tn][K_wts][K_wts];\012\012	unsigned long ti;\012\012	// temporary versions of incremented indices;\012	// same usage as in ZhangIsfpga_2()\012	unsigned long trr, tcc, too, tii;\012\012	// only need to zero BufO in this loop ordering\012	{\012		// indices internal to the block: count from 0\012		unsigned long ioo, icc, irr;\012	  \012		for(ioo=0;ioo<Tm;ioo++) {\012			for(irr=0;irr<Tr;irr++) {\012				for(icc=0;icc<Tc;icc++) {\012					BufO[ioo][irr][icc]=0;\012				}\012			}\012		}\012\012	}\012\012	for(ti=0; ti<N_ifm; ti+=Tn) {\012		{\012			/*\012				* load active input feature map into local buffer\012				*/\012	    \012			// indices internal to the block: count from 0\012			unsigned long irr, icc, iii;\012\012			// incremented temporary indices for input row and col\012			unsigned long xrr, xcc;\012	    \012			for(tii=ti,iii=0;tii<MIN(ti+Tn,N_ifm);tii++,iii++){\012				for(xrr=row*S_wts,irr=0;xrr<(MIN(row+Tr,R_ofm)*S_wts+K_wts-1);xrr++,irr++){\012					for(xcc=col*S_wts,icc=0;xcc<(MIN(col+Tc,C_ofm)*S_wts+K_wts-1);xcc++,icc++){\012						BufI[iii][irr][icc]=ARRAY(input,0,tii,xrr,xcc,0,N_ifm,R_ifm,C_ifm);\012					}\012				}\012			}\012		}\012\012		{\012			/*\012				* load active weights into local buffer\012				*/\012\012				// indices internal to the block: count from 0                                     \012			unsigned long ioo, iii, irr, icc;\012\012			for(too=to,ioo=0;too<MIN(to+Tm,M_ofm);too++,ioo++){\012				for(tii=ti,iii=0;tii<MIN(ti+Tn,N_ifm);tii++,iii++){\012					for(irr=0;irr<K_wts;irr++) {\012						for(icc=0;icc<K_wts;icc++) {\012							BufW[ioo][iii][irr][icc]=ARRAY(weights,too,tii,irr,icc,M_ofm,N_ifm,K_wts,K_wts);\012						}\012					}\012				}\012	      \012				/* write 0s into over-run regions at the end;\012				* this way convolve_kernel() accumulates correctly\012				* without needing a special case */\012				if (iii<Tn) {\012					for(;iii<Tn;iii++) {\012						for(irr=0;irr<K_wts;irr++) {\012							for(icc=0;icc<K_wts;icc++) {\012								BufW[ioo][iii][irr][icc]=0;\012							}\012						}\012					}\012				}\012			}\012		}\012\012		/*\012		* This is the kernel to be implemented on the fabric using\012		* HLS.\012		*\012		* Call as software for Linux and HLS simulation testbench\012		*/\012		//convolve_kernel(bufW, BufI, BufO);\012		unsigned long to_b, ti_b, row_b, col_b;\012\012		unsigned long i, j;\012		for(i=0;i<K_wts;i++){\012			for(j=0;j<K_wts;j++){\012				for(row_b=0;row_b<Tr;row_b++){\012					for(col_b=0;col_b<Tc;col_b++){\012						for(to_b=0;to_b<Tm;to_b++){\012							//#pragma unroll\012							for(ti_b=0;ti_b<Tn;ti_b++){\012								BufO[to_b][row_b][col_b]+=\012									BufW[to_b][ti_b][i][j]*\012									BufI[ti_b][S_wts*row_b+i][S_wts*col_b+j];\012							}\012						}\012					}\012				}\012			}\012		}\012	}\012\012	{\012		/*\012		* unload finished active intermedaite output feature map\012		* from local to full buffer\012		*/\012\012			// indices internal to the block: count from 0                                       \012			unsigned long ioo, icc, irr;\012\012		for(too=to,ioo=0;too<MIN(to+Tm,M_ofm);too++,ioo++){\012			for(trr=row,irr=0;trr<MIN(row+Tr,R_ofm);trr++,irr++){\012				for(tcc=col,icc=0;tcc<MIN(col+Tc,C_ofm);tcc++,icc++){\012					ARRAY(output,0,too,trr,tcc,0,M_ofm,R_ofm,C_ofm)=BufO[ioo][irr][icc];\012				}\012			}\012		}\012	}\012}\012"}, {"path":"/homes/connie/opencl/CNN/cnn_block_maxTs/device/../host/inc/instance.h", "name":"instance.h", "has_active_debug_locs":false, "absName":"/homes/connie/opencl/CNN/cnn_block_maxTs/host/inc/instance.h", "content":"#ifndef INSTANCE_H\012#define INSTANCE_H\012\012/****************************************************************\012 * Copyright (c) 2017~2019, 18-643 Course Staff, CMU\012 * All rights reserved.\012\012 * Redistribution and use in source and binary forms, with or without\012 * modification, are permitted provided that the following conditions\012 * are met:\012\012 * 1. Redistributions of source code must retain the above copyright\012 *    notice, this list of conditions and the following disclaimer.\012\012 * 2. Redistributions in binary form must reproduce the above\012 *    copyright notice, this list of conditions and the following\012 *    disclaimer in the documentation and/or other materials provided\012 *    with the distribution.\012\012 * THIS SOFTWARE IS PROVIDED BY THE COPYRIGHT HOLDERS AND CONTRIBUTORS\012 * \"AS IS\" AND ANY EXPRESS OR IMPLIED WARRANTIES, INCLUDING, BUT NOT\012 * LIMITED TO, THE IMPLIED WARRANTIES OF MERCHANTABILITY AND FITNESS\012 * FOR A PARTICULAR PURPOSE ARE DISCLAIMED. IN NO EVENT SHALL THE\012 * COPYRIGHT OWNER OR CONTRIBUTORS BE LIABLE FOR ANY DIRECT, INDIRECT,\012 * INCIDENTAL, SPECIAL, EXEMPLARY, OR CONSEQUENTIAL DAMAGES\012 * (INCLUDING, BUT NOT LIMITED TO, PROCUREMENT OF SUBSTITUTE GOODS OR\012 * SERVICES; LOSS OF USE, DATA, OR PROFITS; OR BUSINESS INTERRUPTION)\012 * HOWEVER CAUSED AND ON ANY THEORY OF LIABILITY, WHETHER IN CONTRACT,\012 * STRICT LIABILITY, OR TORT (INCLUDING NEGLIGENCE OR OTHERWISE)\012 * ARISING IN ANY WAY OUT OF THE USE OF THIS SOFTWARE, EVEN IF ADVISED\012 * OF THE POSSIBILITY OF SUCH DAMAGE.\012\012 * The views and conclusions contained in the software and\012 * documentation are those of the authors and should not be\012 * interpreted as representing official policies, either expressed or\012 * implied, of the FreeBSD Project.\012 ****************************************************************/\012\012/*\012 * CMU 18643 Fall 2017 Lab Exercise\012 *\012 * The paramters in this file sets the problem sizes\012 *\012 */\012\012/* \012 * weights parameters\012 */\012#define K_wts (4) // weight width and height (square)\012                  // same depth as output\012#define S_wts (1) // sliding stride\012\012/* \012 * output feature map paramters\012 */\012#define R_ofm (16) // height\012#define C_ofm (16) // width\012#define M_ofm (128) // depth\012\012/*\012 * input feature map paramters\012 */\012#define N_ifm (128) // depth\012#define R_ifm (R_ofm*S_wts+K_wts-1) // derived height\012#define C_ifm (C_ofm*S_wts+K_wts-1) // derived width\012\012// Block size. Affects the kernel, so if this value changes, the kernel\012// needs to be recompiled.\012#ifndef BLOCK_SIZE\012#define BLOCK_SIZE 3 // default value, better to be multiple of Tr, Tm, Tc\012#endif\012\012/*\012 * access macro\012 */\012#define ARRAY(ptr,i3,i2,i1,i0,d3,d2,d1,d0) (*((ptr)+(i3)*(d2)*(d1)*(d0)+(i2)*(d1)*(d0)+(i1)*(d0)+(i0)))\012\012#define MIN(a,b) (((a)<(b))?(a):(b))\012\012#define RANGE (100)\012\012#define EPSILON (1e-4)  // do not change this value\012\012/*\012 * Blocking parameters\012 */\012#define max_Tr 8 // output row\012#define max_Tc 8// output column\012#define max_Tm 32 // output depth\012#define max_Tn 32  // input depth\012\012#endif\012"}];
